import React, { useState } from 'react';

const HouseForm = () => {
    const [formData, setFormData] = useState({
        owner_name: '',
        aadhar_number: '',
        length: '',
        breadth: '',
        roof_type: '',
        year_of_construction: '',
        drainage_type: '',
        road_type: '',
        electricity_connection: '',
        house_type: ''
    });

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        fetch('/houses', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(formData),
        })
        .then(response => response.json())
        .then(data => console.log(data))
        .catch(error => console.error('Error:', error));
    };

    return (
        <form onSubmit={handleSubmit}>
            <input type="text" name="owner_name" onChange={handleChange} placeholder="Owner Name" required />
            <input type="text" name="aadhar_number" onChange={handleChange} placeholder="Aadhar Number" required />
            <input type="number" name="length" onChange={handleChange} placeholder="Length (ft)" required />
            <input type="number" name="breadth" onChange={handleChange} placeholder="Breadth (ft)" required />
            <input type="text" name="roof_type" onChange={handleChange} placeholder="Roof Type" required />
            <input type="number" name="year_of_construction" onChange={handleChange} placeholder="Year of Construction" required />
            <input type="text" name="drainage_type" onChange={handleChange} placeholder="Drainage Type" required />
            <input type="text" name="road_type" onChange={handleChange} placeholder="Road Type" required />
            <input type="text" name="electricity_connection" onChange={handleChange} placeholder="Electricity Connection" required />
            <input type="text" name="house_type" onChange={handleChange} placeholder="House Type" required />
            <button type="submit">Submit</button>
        </form>
    );
};

export default HouseForm;
